  \"2016-04-06T23:21:42.011477\",\n\t\"name\": \"cdc-wonder-cancer-statistics\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The United States Cancer Statistics (USCS)
  online databases in WONDER provide cancer incidence and mortality data for the United
  States for the years since 1999, by year, state and metropolitan areas (MSA), age
  group, race, ethnicity,  gender, childhood cancer classifications and cancer site.
  Report case counts, deaths, crude and age-adjusted incidence and death rates,  and
  95% confidence intervals  for rates.  The USCS  data are the official federal statistics
  on cancer incidence from registries having high-quality data and cancer mortality
  statistics for 50 states and the District of Columbia. USCS are produced by the
  Centers for Disease Control and Prevention (CDC) and the National Cancer Institute
  (NCI), in collaboration with the North American Association of Central Cancer Registries
  (NAACCR). Mortality data are provided by the Centers for Disease Control and Prevention
  (CDC), National Center for Health Statistics (NCHS), National Vital Statistics System
  \ (NVSS).</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
